import React from 'react';

const Register = () => {
  return (
	  <div>
      <p className='f3'>
        {'Welcome to PRS Game. Please register so you can start the game'}
      </p>
      <div className='center'>
        <button className= 'f6 link dim ba bw1 ph3 pv2 mb2 dib dark-blue'>Register</button>
      </div>
	  </div>
  );
}

export default Register;
